import './App.css';
import NavBar from './components/navBar/navBar';
import Card from './components/card/card';
import NewApp from './components/NewApp/NewApp';
import Lang from './components/languages/lang';
import Counter from './components/counter/counter';

const countries = [{
  name: 'Oslo',
  capital: 'Norway',
  flags: 'https://flagcdn.com/w320/no.png',
  languages: 'Norwegian',
  currencies: 'crone',
  id: 1,
},
{
  name: 'Italy',
  capital: 'Rome',
  flags: 'https://flagcdn.com/w320/it.png',
  languages: 'Italy',
  currencies: 'euro',
  id: 2,
},
]

const data = countries.map(elem => <Card key={elem.id} data={elem}></Card>);

function App() {

  return (
    <div>
      <NavBar
      item1='docs'
      item2='goods'
      item3='contacts'
      item4='cart'
      />
      {data}
      <NewApp/>
      <Lang/>
      <Counter />
    </div>
  );
}

export default App;
